import React, { useState } from "react";
// import Cards from "./Cards";
import "./App.css";
// import Sdata from "./Sdata";

function App() {
  let newTime = new Date().toLocaleTimeString();
  console.log(newTime);

  const [ctime, setctime] = useState(newTime);

  const UpdateTime = () => {
    let newTime = new Date().toLocaleTimeString();
    console.log(newTime);
    setctime(newTime);
  };

  return (
    <>
      <h1>{ctime}</h1>

      <button onClick={UpdateTime}>Get Time</button>
    </>
  );
}

export default App;
